CREATE DATABASE IF NOT EXISTS identities;

use identities;

create table identities (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	username VARCHAR(50),
	employee_nbr VARCHAR(50),
	active VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	title VARCHAR(50),
	hire_date VARCHAR(50),
	term_date VARCHAR(50)
);
